let productCount =2;
    let isAvailable= 'Unavailable';
    let badgeclass = 'badge-margin-left-40 badge ';
    badgeclass += isAvailable==='Available' ? 'bg-success' : 'bg-danger';
    function displayFormattedProductCount (){
        return (productCount > 0 ? productCount : <p>zero</p> );
    }
function Products (props) 
{ 
    let badgeclass = 'badge-margin-left-40 badge ';
    badgeclass += props.isAvailable ? 'bg-success' : 'bg-danger';

    return (


        <ul className="list-group shadow">
        <li className="list-group-item">
          <div className="media align-items-lg-center flex-column flex-lg-row p-3 d-flex">
            <div className="media-body order-2 order-lg-1">
              <h5 className="mt-0 font-weight-bold mb-2">{props.name}</h5>
              <p className="font-italic text-muted mb-0 small">{props.desc}</p>
              <div className="d-flex align-items-center justify-content-start mt-1">
                <h6 className="font-weight-bold my-2">{props.price}</h6>
                <button className="btn btn-primary">-</button>
                <span style={{padding :'0px 14px' , 'font-size': 13}}>{displayFormattedProductCount()}</span>
                <button className="btn btn-primary">+</button>
                <span className={badgeclass}>{props.isAvailable ? 'Available': 'UnAvailable'}</span>
              </div>
            </div><img src="" alt="Generic placeholder image" width="200" className="ml-lg-5 order-1 order-lg-2" />
            </div>
        </li>
    </ul>

    );
}
export default Products;
